import React from 'react';

function Header() {
  return (
    <div>
        
        <nav class="navbar navbar-inverse">
          <a class="navbar-brand" href="#">Title</a>
          <ul class="nav navbar-nav">
            <li class="active">
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">Link</a>
            </li>
          </ul>
        </nav>
        
    </div>
  );
}

export default Header;
